def transform(sequence):
    n = len(sequence)
    sequence = list(sequence)
    i = 0
    while i < n and sequence[i] != '0':
        i += 1
    j = i
    while j < n and sequence[j] == '0':
        j += 1
    sequence[:j], sequence[i:j] = sequence[i:j], sequence[:i]
    return ''.join(sequence)

def transform(sequence):
    numbers = list(sequence)
    zeros = [num for num in numbers if num == '0']
    others = [num for num in numbers if num != '0']

    return ''.join(zeros + others)

